import React, { Component, useContext } from "react";
import "./App.css";
import CompC from "./components/CompC";
import AppContextProvider from "./contexts/global";

const App = () => {
  return (
    <React.Fragment>
      <AppContextProvider value={this.props}>
        <h1>hello</h1>
      </AppContextProvider>
    </React.Fragment>
  );
};

export default App;
